import "./Product.css";

export default function Product({ photo, title, describtion, price }){
    return (
      <div className="product-cart">
        <img src = {photo} className="image"/>
        <h2>{title}</h2>
        <p>{describtion}</p>
        <p>{price}</p>
      </div>
    )
}
